package main

import (
	"fmt"
	"strings"
)

func main() {
	digitOne := ""
	digitTwo := ""
	digitThree :=
		""
	digitFour :=
		""
	digitFive :=
		""

	getPass(digitOne)
	getPass(digitTwo)
	getPass(digitThree)
	getPass(digitFour)
	getPass(digitFive)
}

func getPass(line string) {
	row1 := []string{"x", "x", "1", "x", "x"}
	row2 := []string{"x", "2", "3", "4", "x"}
	row3 := []string{"5", "6", "7", "8", "9"}
	row4 := []string{"x", "A", "B", "C", "x"}
	row5 := []string{"x", "x", "D", "x", "x"}

	key := [][]string{row1, row2, row3, row4, row5}
	// fmt.Println(key)

	pos := []int{2, 0}
	movements := map[string][]int{"U": []int{-1, 0}, "R": []int{0, 1}, "D": []int{1, 0}, "L": []int{0, -1}}

	instruct := strings.Split(line, "")
	for _, v := range instruct {
		next := movements[v]
		newpos := []int{pos[0] + next[0], pos[1] + next[1]}
		if newpos[0] < 0 || newpos[0] > 4 || newpos[1] < 0 || newpos[1] > 4 || key[newpos[0]][newpos[1]] == "x" {
			continue
		}

		pos = newpos
	}
	digit := key[pos[0]][pos[1]]
	fmt.Println(digit)
}
